import React,{Component} from 'react'
import logo from './logo.svg';
import './App.css';

class App extends Component {
  //const App = () => {
  render() {
    return (
      <div className="App">
        <div className="App-header">

          <h2>hello</h2>
        </div>
        <p className="App-intro">
          你可以在 <code>src/App.js</code> 文件中修改。
        </p>
      </div>
    );
  }
}

export default App;
